    [],nt"title": "Fisheries-Independent Biological and Environmental Trawl Data
    from the Mississippi Department of Marine Resources and the University of Southern
    Mississippi's Gulf Coast Research Laboratory (1973-2005) as Part of the Comparative
    Assessment of Gulf Estuarine Systems (CAGES) Database (NODC Accession 0115183)",nt"tracking_summary":
    {ntt"total": 4,ntt"recent": 1nt},nt"groups": [],nt"relationships_as_subject":
    [],nt"revision_timestamp": "2015-09-26T22:41:26.560735",nt"name": "fisheries-independent-biological-and-environmental-trawl-data-from-the-mississippi-department-o",nt"isopen":
    false,nt"url": null,nt"notes": "The CAGES program (Comparative Assessment
    of Gulf Estuarine Systems) is designed to examine the differences between estuarine
    ecosystems and investigate why some are more productive than others. The program
    focuses on estuarine areas important to commercial fisheries and includes data on
    commercial finfish and invertebrate species, as well as other species commonly captured
    in trawl sampling. This Mississippi dataset is a subset of the CAGES Relational
    Database which is a compilation of fishery-independent data contributed by natural
    resource agencies of the Gulf States (Texas, Louisiana, Mississippi, Alabama, and
    Florida). This data set includes data from trawls collected by the Mississippi Department
    of Marine Resources and the University of Southern Mississippi's Gulf Coast Research
    Laboratory (MDMR/GCRL), as well as associated hydrographic data. Trawl data were
    used to calculate CPUE (catch per unit effort) at each station for the years 1973
    through 2005.",nt"license_title": null,nt"extras": [{ntt"key": "bbox-east-long",ntt"value":
